const Navigation = () => {
    return (
        <nav classname="#navbar {
            position: fixed;
            background: #FFFFFF;
            box-shadow: 0 10px 5px #888888;
            display: flex;
            flex-direction: column;
            flex-direction: row;
            width: 99%;
            height: 20vh;
          }" style={{display: 'flex', justifyContent: 'flex-end'}}>
            <p className='f3 link dim black pa3 pointer'>Sign Out</p>
        </nav>
    );
}

export default Navigation;
